import React from "react";
import Contract from "./Contract";
import "./styles/Contracts.css";
import "./styles/GridLayout.css";

const ContractContainer = (props) => (
  <div className="contractContainer">
    <Contract className="col-4" name={props.contracts.name} startDate={props.contracts.startDate} endDate={props.contracts.endDate} startPrice={props.contracts.startPrice} description={props.contracts.description}/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
    <Contract className="col-4"/>
  </div>
);

export default ContractContainer;
